response.about:
Вера Тимофеевна занимается целительской практикой более 30 лет и является одним из сильнейших специалистов в биоэнергоинформотерапия. Производит полную диагностику и лечит заболевания:
- Желудочно-кишечного тракта: холециститы, панкреатиты, цирроз печени (удивительные результаты, документально подтверждены специалистами традиционной медицины), жировой гепатоз;
- Опорно-двигательного аппарата (остеохондроз, сколиоз, радикулит и т.д.);
- Сердечно-сосудистой системы, органов дыхания;
- Папилломавируса, цитомегаловирусы, герметичные инфекции;
- Гинекологические болезни; доброкачественные опухоли и др.
